Based on my reading of the paper, IF you are implementing the comparison to a constant (Y value) case and choosing the colors of the bar you do not need to compute p-values and such. Per my reading of the paper (which I think is right but could be wrong) - what is needed to be done is the following logic. (Of course you still need to map to color where what you show above is useful).
Note: line_yval = constant y_val of line specified on y axis, bar0_typ_val is the typical value of the bar0, bar0_UCIval is bar0's upper confidence interval value, bar0_LCI_val is bar0's lower confidence interval value.
For each bar from 0 to 3:
if line_yval > bar0_typ_val:
if line_yval > bar0_UCIval:
bar0color = darkblue (here you can assign value and later map to colormap)
else:
bar0color = lightblue (same comment as above)
if line_yval = bar0_typ_val:
bar0color = white (use value to map to colormap)
if line_yval < bar0_typ_val:
if line_yval < bar0_LCI_val:
bar0color = darkred (use value to map to colormap)
else:
bar0color = lightred
Would appreciate if some one double checked my logic but I think that is it barring mapping values to colormap.
Comments/Feedback welcome.
